import React from 'react';
import './App.css';
import Compass from "./components/compass"



class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {heading: 4.3};
  }

  componentDidMount() {
    this.interval = setInterval(() => this.setState((state) => {
      return {heading: (this.state.heading + (Math.random() - 0.3) * 1) % 360};
    }), 10);
  }

  render() {
    return (
      <div>
        <div className="table">
          <Compass width={300} height={300} heading={this.state.heading + Math.random() * 10} />
          <Compass width={300} height={300} heading={this.state.heading} />
        </div>
        <div className="table">
          <Compass width={600} height={600} heading={this.state.heading} />
        </div>
      </div>
    );
  }
}

export default App;
